def convert_to_dict(puzzle):
    size = len(puzzle)
    variables_dict = {}
    for i in range(size):
        for j in range(size):
            cell_key = 'C{}{}'.format(i + 1, j + 1)
            if not puzzle[i][j]:
                variables_dict[cell_key] = list(range(1, 10))
            else:
                variables_dict[cell_key] = [puzzle[i][j]]
    return variables_dict

