#Part 2: Revise

"""
Parameters: takes in CSP and name of two variables 
modifies the CSP, removing any value in var1's domain where there isn't a corresponding val in var2's domain that satisfies the constraint
Return: boolean indicating if any values were removed
"""
def revise(csp, var1, var2):
    variables, constraints = csp["variables"], csp["constraints"]

    if not variables.get(var1) or not variables.get(var2):
        return False

    domain1, domain2 = variables[var1], variables[var2]

    new_domain1 = [
        x for x in domain1 if any(
            [x, y] in constraints.get((var1, var2), []) or
            [x, y] in constraints.get((var2, var1), [])
            for y in domain2
        )
    ]

    revised = domain1 != new_domain1

    if revised:
        variables[var1] = new_domain1

    return revised

