#Part 3: AC3

"""
Parameters: takes in CSP
modifies CSP so inconsistent values are removed
Return: boolean indicating whether all variables have at least one value left in their domain
"""

def get_neighbors(csp, Xi, Xj):
    neighbors = []
    for constraint in csp['constraints']:
        if Xi in constraint and Xj not in constraint:
            neighbor = "".join(constraint).replace(Xi, '')
            neighbors.append(neighbor)
    return neighbors


def ac3(csp):
    variables, constraints = csp["variables"], csp["constraints"]
    queue = deque(constraints.keys())

    while queue:
        Xi, Xj = queue.popleft()
        if revise(csp, Xi, Xj):
            if len(csp['variables'][Xi]) == 0:
                return False
            for Xk in sorted(get_neighbors(csp, Xi, Xj)):
                    queue.append((Xk, Xi))
    return True


