def minimum_remaining_values(csp, assignments):
    unassigned_variables = [var for var in csp['variables'] if var not in assignments]
    min_var = None
    min_domain_size = float('inf')
    for var in unassigned_variables:
        if len(csp['variables'][var]) < min_domain_size:
            min_domain_size = len(csp['variables'][var])
            min_var = var
    return min_var

