def depth_to_rgb(depth, max_depth):
    if max_depth == 0:
        return depth, (0, 0, 255)

    # Calculate the hue based on depth (ranging from 120 to 240, green to blue)
    hue = 240 - ((depth / max_depth) * 120)

    # Convert hue to RGB
    rgb = colorsys.hsv_to_rgb(hue / 360.0, 1.0, 1.0)

    # Scale RGB values to the range [0, 255]
    scaled_rgb = [int(val * 255) for val in rgb]

    return depth, tuple(scaled_rgb)


def convert(depth_map):
    depth_rgb_map = {}
    if depth_map is not None:
        depth_map = {var: depth for var, depth in depth_map.items() if depth is not None}

        if depth_map:
            max_depth = max(depth_map.values())
            print("max de", max_depth)
            depth_rgb_map = {var: depth_to_rgb(depth, max_depth) for var, depth in depth_map.items()}

    return depth_rgb_map



"""
Parameters: CSP 
Return: the SOLUTION, the ORDER in which it assigned the variables, the DOMAINS of remaining unassigned variables after each assignment

Notes: 
- finds a valid assignment for all the variables in the CSP, if one exists
- leverage your AC-3 for consistency 
- use min remaining values heuristic to choose a variable to assign 
- keep track of failed values 
"""
def backtracking_search(csp, assignments, assignment_order, backtrack_count, failed_values, solution_steps, depth, depth_map = {}, depth_rgb_map = {}):
    variables = csp["variables"]
    constraints = csp["constraints"]

    unassigned_vars = [var for var in variables if var not in assignments]

    if not unassigned_vars:
        solution_step = {cell: {'value': assignments[cell], 'depth': depth_map.get(cell, 0), 'rgb': depth_to_rgb(depth_map.get(cell, 0), 50)} for cell in assignments}
        solution_steps.append(solution_step)
        return assignments, assignment_order, backtrack_count, failed_values, solution_steps, depth, depth_map, depth_rgb_map

    # Append the initial state as step 1
    if not solution_steps:
        initial_step = {cell: {'value': assignments[cell], 'depth': depth_map.get(cell, 0), 'rgb': depth_to_rgb(depth_map.get(cell, 0), 50)} for cell in assignments}
        solution_steps.append(initial_step)

    var = minimum_remaining_values(csp, assignments)
    domain = variables[var]
    backtrack_count[var] = 0
    failed_values[var] = []

    for value in domain:
        if var not in assignments or assignments[var] != value:
            new_assignments = assignments.copy()
            new_assignments[var] = value

            depth_map[var] = depth

            solution_step = {cell: {'value': new_assignments[cell], 'depth': depth_map.get(cell, 0), 'rgb': depth_to_rgb(depth_map.get(cell, 0), 50)} for cell in new_assignments}

            # Avoid appending duplicate steps
            if new_assignments != solution_steps[-1] and len(variables[var]) > 1:
                solution_steps.append(solution_step)

            # Assign depth and color for each cell in the current step
            step_idx = len(solution_steps) - 1
            for cell, cell_value_depth_rgb in solution_step.items():
                depth_rgb_map.setdefault(step_idx, {}).setdefault(cell, cell_value_depth_rgb['rgb'])


        assignment_order.append(var)


        new_domains = {v: list(d) for v, d in variables.items()}
        new_domains[var] = [value]

        new_csp = {'variables': new_domains, 'constraints': constraints}

        if ac3(new_csp):
            result = backtracking_search(new_csp, new_assignments, assignment_order, backtrack_count, failed_values, solution_steps, depth+1, depth_map, depth_rgb_map)  # Pass the new CSP
            if result:
                return result

        backtrack_count[var] += 1
        failed_values[var].append(value)
        assignment_order.pop()

    return None



