def trim_solution_steps(solution_steps):
    trimmed_solution_steps = []

    # Add the last step to the trimmed_solution_steps
    trimmed_solution_steps.append(solution_steps[-1])

    # Iterate over each step in reverse order starting from the second last
    for i in range(len(solution_steps) - 2, -1, -1):
        # Check if the current step fills a blank cell
        if len(solution_steps[i].keys()) < len(trimmed_solution_steps[-1].keys()):
            trimmed_solution_steps.append(solution_steps[i])

    # Reverse the trimmed_solution_steps to maintain the original order
    trimmed_solution_steps.reverse()

    return trimmed_solution_steps


