@app.route('/')
def solve():
    if request.args.get('board'):
        # If the user puts a board in the URL
        board = request.args.get('board')
        print(board)
        print(json.loads(board))
        puzzle_board = convert_to_dict(json.loads(board))
    else:
        # if no URL is specified, use Puzzle 1 as the default
        print(puzzle_1)
        puzzle_board = convert_to_dict(puzzle_1)

    assignments = convert_to_assignments(puzzle_board)

    puzzle = {"variables": puzzle_board, "constraints": constraint9x9}

    result = backtracking_search(puzzle, assignments, [], {}, {}, [], 0, {}, {})

    failed_values = result[3]
    solution_steps = result[4]
    trimmed_steps = trim_solution_steps(solution_steps)

    all_puzzle_grids = []

    for step in trimmed_steps:
        puzzle_grid = [[''] * 9 for _ in range(9)]
        for cell, value in step.items():
            row, col = int(cell[1]) - 1, int(cell[2]) - 1
            # If there are failed values for the cell, include them along with the final value
            if cell in failed_values:
                cell_values = [value['value']] + [v for v in failed_values[cell] if v != value]
            else:
                cell_values = value['value']

            puzzle_grid[row][col] = {'value': cell_values, 'rgb': value['rgb']}

        all_puzzle_grids.append(puzzle_grid)

    return render_template_string(template, all_puzzle_grids=all_puzzle_grids)


